import React from "react";
import { Link } from "react-router-dom";

const Nav = () => {
  return (
    <div className="navbar">
      <Link to="/">Title</Link>

      <div className="navbar-menu">
        <li>
        <Link className="menu-item" to="/logout">
          Log in
        </Link>
        </li>
        <li></li>

      </div>
    </div>
  );
};

export default Nav;
